    getAllProducts()
    .then(data => {
      console.log(data)
    })
    .catch(error => console.log(error));
  }

  return (
    <section className="shop-section">
      <div className="hero-sec">
        <h1>This is hot hero section</h1>
      </div>

      <div className="products-sec">
        <h1>This is hot product section</h1>
      </div>
    </section>
  );
};

export default Shop;
